import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { ChakraProvider } from "@chakra-ui/react"

const tagsContext = React.createContext();
function getalltags() {
  frontface = JSON.parse(localStorage.getItem('frontface'))
}

ReactDOM.render(
  <React.StrictMode>
    <ChakraProvider>
      <tagsContext>
        <App />
      </tagsContext>
    </ChakraProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
